import texture from "../../assets/texture.svg";

import s from "./Help.module.css";

const Help = () => {
  return (
    <div className={s.container}>
      <div className={s.inner}>
        <p className={s.title}>
          Помогите сообществу <br />
          Честные люди
        </p>
        <img src={texture} alt="texture" />
      </div>
    </div>
  );
};

export default Help;
